# ========================================
#
# Datlab config variables
#
# ========================================
project.name=datlab
project.version=2.0
rabbitmq.host=messaging01
rabbitmq.username=datlab
rabbitmq.password=datlab
daofactory.type=JDBC

tor.socksProxyHost = 127.0.0.1
tor.socksProxyPort = 9050
tor.socksNonProxyHosts = 127.0.0.1|localhost

additionalPropertyFiles=indicator.properties, zindex.properties

cache.enabled = true
cache.implementation = cache2k
cache.redis.host = localhost
cache.redis.port = 6379

